import React from "react";
function handle(e){
    const data=e.target;
    const fd=FormData(data)
    const abc=Object.entries(fd.entries)
    document.getElementById('1').innerHTML=" "+abc.user;
}
function Iphandling(){
    return(
        <div className="Iphandling">
            <form method='post' onSubmit={handle}>
                <label>user name</label>
                <input type="user" defaultValue={"enter value"}/>
                <label>Password</label>
                <input type="password" name={"pwd"}></input>
                <input type="button" value={"signin"}></input>
                <h1 id='1'></h1>
            </form>
        </div>
    )
}
export default Iphandling;
